import React, { Component } from 'react';

import check from './../../../../Assets/Icons/check.svg';
import x from './../../../../Assets/Icons/x.svg';
class Three extends Component {
    state = {  } 
    render() { 
        return (
            <div className='whole'>


                <div className='informationPrio'>
                    <p id = "title">What information do I need to prioritize?</p>

                    <div className='col-lg-2'> 
                    <p></p></div>
                    <div id = "listed">
                        <div className='listSheet col-lg-3 col-sm-12'>
                            <div className='List'>
                                <ul><div id = "textInside"><img src={check}></img>Location</div></ul>
                                <ul><div id = "textInside"><img src={check}></img>Prices</div></ul>
                                <ul><div id = "textInside"><img src={check}></img>Form</div></ul>
                                <ul><div id = "textInside"><img src={x}></img>Policy</div></ul>
                                <ul><div id = "textInside"><img src={x}></img>FAQ</div></ul>
                            </div>
                        </div>

                        <div className='listedDesc col-lg-6'>

                            <p id = "paragraph">
                            In order for me to get started with the foundation of the website, 
                            I have to consider what information I can have access to in a timely manner. 
                            </p>
                            <p id = "paragraph">
                            Since the start of the project was postponed due to lack of information, 
                            I had to work with the content that is most important to improve business clientelle. 
                            </p>

                        </div>
                    </div>           

                </div>

            </div>
        );
    }
}

export default Three;
